<!DOCTYPE html>
<html>

<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width,initial-scale=1,minimum-scale=1">
    <style>
        header {
            height: 50px;
            width: 100%;
            background-color: rgb(55, 63, 91);
            background-size: cover;
            margin-bottom: 6.18px;
        }

        .copy-button {
            height: 62px;
            width: 62px;
            background-color: rgba(255, 255, 255, 0.5);
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            font-size: 38.2px;
            font-family: "Arial", sans-serif;
            border-radius: 16.18px;
            cursor: pointer;
            position: relative;
            border: none;
            display: inline-block;
            margin: 0;
            padding: 0;
            text-align: center;
            margin-left: 5px;
            margin-right: 5px;
        }


        .copy-button .square {
            height: 62px;
            width: 62px;
            background-color: rgba(255, 255, 255, 0);
            border-radius: 10px;
            font-size: 38.2px;
            font-family: "Arial", sans-serif;
            color: white;
            display: flex;
            align-items: center;
            justify-content: center;
            position: absolute;
            top: 0;
            left: 0;
            text-align: center;
            border: none;
            display: inline-block;
            margin: 0;
            padding: 0;
            height: 63px;
            display: flex;
            text-align: center;
        }

        body {
            background-color: #0e0f10;
            background-image: url(./img/BGbit3.png);
            background-size: 10px 10px;
            margin: 0;
            padding: 0;
        }

        .overlay {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            background: rgba(255, 255, 255, 0.7);
            z-index: 999;
            display: none;
        }

        .loader {
            width: 80px;
            height: 80px;
            position: absolute;
            top: 50%;
            left: 50%;
            margin: -40px 0 0 -40px;
            border: 10px solid #dddddd;
            border-top: 10px solid #7cc42d;
            border-radius: 50%;
            animation: spin 2s linear infinite;
        }
        
        @keyframes spin {
            0% {
                transform: rotate(0deg);
            }

            100% {
                transform: rotate(360deg);
            }
        }
    </style>
    <div class="overlay">
        <div class="loader"></div>
    </div>

        // Add the text content for each button

        function showOverlay() {
            document.querySelector(".overlay").style.display = "block";
        }

        // Hide the overlay
        function hideOverlay() {
            document.querySelector(".overlay").style.display = "none";
        }

        // Show the overlay before generating buttons
        window.onload = function () {
            showOverlay();
            setTimeout(function () {
                var buttonsContainer = document.getElementById("buttons-container");
                for (var i = 0; i < textArray.length; i++) {
                    var button = document.createElement("button");
                    button.setAttribute("class", "copy-button");
                    button.setAttribute("data-clipboard-text", textArray[i]);
                    button.innerHTML = "<div class='square'>" + textArray[i] + "</div>";
                    buttonsContainer.appendChild(button);
                }
                var clipboard = new ClipboardJS('.copy-button');
                clipboard.on('success', function (e) {
                    console.log(e);
                });
                clipboard.on('error', function (e) {
                    console.log(e);
                });

                // Hide the overlay after generating buttons
                hideOverlay();
            }, 500);
        };
    </script>

<body>
    <header></header>
    <div id="buttons-container"></div>
